import { useState } from "react";
import { useNavigate } from "react-router-dom";
import processLogin from "../../form-processing/login";
import { formType } from "../../../globals/constants";
import { canRoute, empRoute, candidate, employer } from "../../../globals/route-names";

function SignInPopup() {
    const navigate = useNavigate();
    const [canCredentials, setCanCredentials] = useState({ username: "", password: "" });
    const [empCredentials, setEmpCredentials] = useState({ username: "", password: "" });
    const [error, setError] = useState("");

    const handleChange = (type, field, value) => {
        if (type === "candidate") {
            setCanCredentials({ ...canCredentials, [field]: value });
        } else {
            setEmpCredentials({ ...empCredentials, [field]: value });
        }
    };

    const handleLogin = async (type) => {
        const credentials = type === "candidate" ? canCredentials : empCredentials;

        try {
            const response = await processLogin({
                type: type === "candidate" ? formType.LOGIN_CANDIDATE : formType.LOGIN_EMPLOYER,
                ...credentials,
            });
            if (response.valid) {
                navigate(type === "candidate" ? canRoute(candidate.DASHBOARD) : empRoute(employer.DASHBOARD));
            } else {
                setError("Invalid username or password.");
            }
        } catch {
            setError("An error occurred during login.");
        }
    };

    return (
        <div className="modal fade" id="sign_in_modal" aria-hidden="true">
            <div className="modal-dialog modal-dialog-centered">
                <div className="modal-content">
                    <div className="modal-header">
                        <h2>Login</h2>
                        <p>Access exclusive features by logging in.</p>
                        <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                    </div>
                    <div className="modal-body">
                        {error && <p className="text-danger">{error}</p>}
                        <ul className="nav nav-tabs">
                            <li className="nav-item">
                                <button className="nav-link active" data-bs-toggle="tab" data-bs-target="#candidate-tab">
                                    Candidate
                                </button>
                            </li>
                            <li className="nav-item">
                                <button className="nav-link" data-bs-toggle="tab" data-bs-target="#employer-tab">
                                    Employer
                                </button>
                            </li>
                        </ul>
                        <div className="tab-content">
                            <div id="candidate-tab" className="tab-pane fade show active">
                                <input
                                    type="text"
                                    className="form-control mb-2"
                                    placeholder="Username"
                                    value={canCredentials.username}
                                    onChange={(e) => handleChange("candidate", "username", e.target.value)}
                                />
                                <input
                                    type="password"
                                    className="form-control mb-2"
                                    placeholder="Password"
                                    value={canCredentials.password}
                                    onChange={(e) => handleChange("candidate", "password", e.target.value)}
                                />
                                <button onClick={() => handleLogin("candidate")} className="btn btn-primary w-100">
                                    Login
                                </button>
                            </div>
                            <div id="employer-tab" className="tab-pane fade">
                                <input
                                    type="text"
                                    className="form-control mb-2"
                                    placeholder="Username"
                                    value={empCredentials.username}
                                    onChange={(e) => handleChange("employer", "username", e.target.value)}
                                />
                                <input
                                    type="password"
                                    className="form-control mb-2"
                                    placeholder="Password"
                                    value={empCredentials.password}
                                    onChange={(e) => handleChange("employer", "password", e.target.value)}
                                />
                                <button onClick={() => handleLogin("employer")} className="btn btn-primary w-100">
                                    Login
                                </button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default SignInPopup;
